		.main-p.show {opacity:1; transform:translateY(0%);}
		
		.ke4 {opacity:0; transform:translateY(-10%); transition: all 1s ease 1.2s; }
		.ke4.show {opacity:1; transform:translateY(0%); }
		.search {opacity:0; transform:translateY(-10%); transition: all 0.3s ease 1.2s;}
		.search.show{
			opacity:1; transform:translateY(0%);
			opacity:1; transform:translateY(0%); 
			animation-name: floating;
			animation-duration: 1.5s;	
			animation-iteration-count: infinite;
		}

		
		.img1 {opacity:0; transform:translateY(-10%); transition: all 0.3s ease 1s;}
		.img1.show{opacity:1; transform:translateY(0%); }
		.stty2 {opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; }
		.stty2.show {opacity:1; transform:translateY(0%); }
		.bulb {opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; }
		.bulb.show {
			opacity:1; transform:translateY(0%);
			opacity:1; transform:translateY(0%); 
			animation-name: floating;
			animation-duration: 1.5s;	
			animation-iteration-count: infinite;
		}
		
		.img2 {opacity:0; transform:translateY(-10%); transition: all 0.3s ease 1.5s;}
		.img2.show{opacity:1; transform:translateY(0%); }
		.ke2 {opacity:0; transform:translateY(-10%); transition: all 1s ease 1.5s; }
		.ke2.show {opacity:1; transform:translateY(0%); }
		
		.web {opacity:0; transform:translateY(-10%); transition: all 1s ease 2s; }
		.web.show {
			opacity:1; transform:translateY(0%); 
			animation-name: floating;
			animation-duration: 1.5s;	
			animation-iteration-count: infinite;
		}
		.sttt {opacity:0; transform:translateY(-10%); transition: all 1s ease 2s;  }
		.sttt.show {opacity:1; transform:translateY(0%);transition-delay:1s;}
		
		/* 프로그래밍 단어 바운스 애니메이션 */
		.codingtit{
			opacity: 0;
			transition-delay: 2.5s
		}
		.codingtit.show{
			opacity: 1;
			animation-name: bounce;
			animation-duration: 1s;
			animation-timing-function: ease;
			animation-iteration-count: 1;
			animation-delay: 2.5s;
		}
		
		.uxtitle{
			opacity: 0;
			transition-delay: 2s
		}
		.uxtitle.show{
			opacity: 1;
			animation-name: bounce;
			animation-duration: 1s;
			animation-timing-function: ease;
			animation-iteration-count: 1;
			animation-delay: 2s;
		}
		.svg2 {
			opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; 	
		}
		.svg2.show{
			opacity:1; transform:translateY(0%);transition-delay:2s;
		}
		.svg3 {
			opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; 	
		}
		.svg3.show{
			opacity:1; transform:translateY(0%);transition-delay:3s;
		}
		
		.about-ladder {
			opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; 
		}
		.about-ladder.show {
			opacity:1; transform:translateY(0%);transition-delay:3s;
		}
		.star1{
			opacity: 0;
			transition-delay: 2.5s
		}
		.star1.show{
			opacity: 1;
			animation-name: flash;
			animation-duration: 4s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 2.5s;
		}
		.star2{
			opacity: 0;
			transition-delay: 2.8s
		}
		.star2.show{
			opacity: 1;
			animation-name: flash;
			animation-duration: 4s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 2.8s;
		}
		.star3{
			opacity: 0;
			transition-delay: 2.3s
		}
		.star3.show{
			transform:translate(155px, -80px);
			opacity: 1;
			animation-name: flash;
			animation-duration: 4s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 2.3s;
		}
		.star4{
			opacity: 0;
			transition-delay: 3s
		}
		.star4.show{
			opacity: 1;
			animation-name: flash;
			animation-duration: 5s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 3s;
		}
		.star5{
			opacity: 0;
			transition-delay: 2.2s
		}
		.star5.show{
			opacity: 1;
			animation-name: flash;
			animation-duration: 5s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 2.2s;
		}
		.star6{
			transform:translate(255px, 10px);
			opacity: 0;
			transition-delay: 2.5s
		}
		.star6.show{
			opacity: 1;
			animation-name: flash;
			animation-duration: 4s;
			animation-timing-function: ease;
			animation-iteration-count:infinite;
			animation-delay: 2.5s;
		}


		.contact-ladder {
			opacity:0; transform:translateY(-10%); transition: all 1s ease 1s; 
		}
		.contact-ladder.show {
			opacity:1; transform:translateY(0%);transition-delay:3.5s;
		}
		
	

		@keyframes floating {
			0% {
				transform: translateY(0%);	
			}
			50% {
				transform: translateY(3%);	
			}	
			100% {
				transform: translateY(0%);
			}			
		}
		@keyframes slideUp {
			0% {
				transform: translateY(100%);
			}
			50%{
				transform: translateY(-8%);
			}
			65%{
				transform: translateY(4%);
			}
			80%{
				transform: translateY(-4%);
			}
			95%{
				transform: translateY(2%);
			}			
			100% {
				transform: translateY(0%);
			}	
		}
